import React from "react";
import addedTasks from "../util/addedTasks";

const Tasks = () => {
  return (
    <div className="tasks-div">
      {addedTasks.map((task) => (
        <div className="single-task">
          <p>{task.name}</p>
          <button>done</button>
        </div>
      ))}
    </div>
  );
};

export default Tasks;
